import React, { useEffect, useState } from "react";
import axios from "axios";

const Summon = props => {

  useEffect(() => {
    axios.get("http://battlecat.stark.mmi-unistra.fr/users/" + sessionStorage("userconnected")).then(response => {
      setBreeds(response.data);
    });
  }, []);

  return (
    <div>
        <h1>Invoquer un chat</h1>
        <p>Vous avez 9999 points.</p>
        <a className="ghostButton" href="">Invoquer un chat ? (10 points)</a>
    </div>
  );
};


export default Summon;
